  return (
  <>
                   <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/Contact">Contact</Link></li>
            <li><Link to="/About">About</Link></li>
         <li><Link to="/About">Login</Link></li> 
        </ul>

  </>
  );
};


function Header() {
  return (
    
    
    <div className="HeaderBody">
        <Navigation/>
       <div className="headerBackground">

       </div>
        
        
      
    
    </div>
    

    
    
  )
}

export default Header
